// SPDX-License-Identifier: MIT
pragma solidity ^0.8.30;

contract SimpleBank {

    mapping(address => uint) public balances;

    // Event for withdrawals
    event Withdrawn(address indexed user, uint amount);

    // Payable deposit function
    function deposit() public payable {
        require(msg.value > 0, "Must send some ETH");
        balances[msg.sender] += msg.value;
    }

    // Withdraw function
    function withdraw(uint amount) public {
        require(balances[msg.sender] >= amount, "Insufficient balance"); // Check balance

        balances[msg.sender] -= amount; // Effect first

        // Send Ether using call
        (bool success, ) = payable(msg.sender).call{value: amount}("");
        require(success, "Withdraw failed"); // Ensure transfer succeeded

        emit Withdrawn(msg.sender, amount); // Emit event
    }

    // Check balance
    function getBalance() public view returns (uint) {
        return balances[msg.sender];
    }
}

